INSERT INTO `course` (`uuid`, `name`, `description`, `year_from`, `year_to`, `price_semester_1`, `price_semester_2`, `modif_at`, `modif_by`, `max_participant_count`, `course_location_uuid`) VALUES
('a6d17e70-1879-454b-9818-bad448836a04', 'Chci se naučit plavat- Čapkárna po, st 17,00', 'Cena: 2900,-Kč/ pololetí/ 2 tréninky za týden \n\nPlavecké kurzy jsou určené pro děti, které se chtějí naučit plavat. Zdokonalujeme techniku jednotlivých plaveckých způsobů. Kraul, znak, prsa a pro zdatné děti i motýlek. V dětech probouzíme malé závodníky, ale také klademe důraz na hry, soutěže, potápění, lovení předmětů či skoky do vody. Plavecké kurzy jsou vstupní bránou k závodnímu plavání, nezáleží nám na věku, ale na schopnostech.\n- skupina je určená dětem, které zvládají základní plavecké dovednosti – dýchání do vody a plavání s pomůckami\nCo by dítě mělo zvládnout: plavání s pomůckami do vzdálenosti min.10 m\n\nDoporučený věk: 6 - 12  let\n\nNáplň: výuka tří plaveckých způsobů – znak, prsa, kraul, učení herní formou, výuka je vedena s cílem oblíbit si plavání jako vhodnou formu využití volného času \n', 2018, 2019, 2900, 2900, '2018-09-13 07:15:39', 'p.formankova', 16, '4ec93cb3-808e-4ca7-89f3-75cb46889d51'),
('40b2caf3-7883-483f-befa-cb3f28b31629', 'Chci se zdokonalit - Poruba', 'Cena: 3000,-Kč/pololetí/2 tréninky za týden\n\nPopis skupiny: Některé děti nechtějí být závodním plavcem, ale přesto se chtějí dále v plavání zdokonalovat nebo mají plavání jako doplňkový sport. Právě pro ně máme zdokonalovací plavání.  Zde se věnujeme rozvíjení pohybových dovedností a zdokonalování všech plaveckých způsobů. Pravidelným tréninkem zlepšujeme u dětí kondici, vytrvalost, podporujeme zdravý způsob života, ke kterému neodmyslitelně pohyb patří.\n-tuto skupinu navštěvují děti, které plavání baví, jako aktivní využití volného času, neúčastní se závodů, po domluvě s trenérem tuto účast umožňujeme\n\nCo by dítě mělo zvládnout: základy techniky plaveckých způsobů znak, prsa a kraul, uplavat bez pomoci 50m\n\nDoporučený věk: 13 - 20 let\n\nNáplň: zdokonalovaní plaveckých způsobů znak, prsa, kraul, základy motýla, plavání s pomůckami, hry\n\nPřípadné dotazy ohledně zařazení konzultujte s vedoucí plaveckých kurzů sl. Formánkovou', 2018, 2019, 3000, 3000, '2018-09-18 07:03:17', 'p.formankova', 20, 'bc577f2f-b930-4164-ac73-1907c5393c67'),
