('3d76060e-d86c-4128-ab59-fbebb6741204', 'Nechci se bát vody- Poruba', 'Cena: 2900,-Kč/ pololetí/ 2 tréninky za týden\n\n První plavecké krůčky všech dětí začínají většinou v prostoru dětského bazénu. Cílem výuky je rozvíjet kladný vztah k vodě, snažíme se, aby se děti vždy na plavání těšily, proto je hodina vedená herním stylem, který děti baví. Naučíme děti dýchat do vody, potápět se, splývat a skákat. Využíváme plavecké pomůcky, kde klademe důraz na pestrost a zábavu. K dětem přistupujeme dle schopnosti každého jednotlivého dítěte. Výuka probíhá v malém i ve velkém bazénu, dle schopností dětí.\n\nDoporučený věk: 4 – 6 let\n\n', 2018, 2019, 2900, 2900, '2018-09-09 12:23:30', 'p.formankova', 12, 'bc577f2f-b930-4164-ac73-1907c5393c67'),
('81d7e48a-0759-41d3-9751-23f64f834db6', 'Nechci se bát vody- Poruba', 'Cena: 2900,-Kč/ pololetí/ 2 tréninky za týden\n\n První plavecké krůčky všech dětí začínají většinou v prostoru dětského bazénu. Cílem výuky je rozvíjet kladný vztah k vodě, snažíme se, aby se děti vždy na plavání těšily, proto je hodina vedená herním stylem, který děti baví. Naučíme děti dýchat do vody, potápět se, splývat a skákat. Využíváme plavecké pomůcky, kde klademe důraz na pestrost a zábavu. K dětem přistupujeme dle schopnosti každého jednotlivého dítěte. Výuka probíhá v malém i ve velkém bazénu, dle schopností dětí. \n\nDoporučený věk: 4 – 6 let\n\n', 2018, 2019, 2900, 2900, '2018-09-09 12:22:10', 'p.formankova', 30, 'bc577f2f-b930-4164-ac73-1907c5393c67'),
('78f34d0f-9036-4d9d-9aab-20b1bda2ad5d', 'Chci se naučit plavat-Čapkárna po, st 18,00', 'Cena: 2900,-Kč/ pololetí/ 2 tréninky za týden\n\nPlavecké kurzy jsou určené pro děti, které se chtějí naučit plavat. Zdokonalujeme techniku jednotlivých plaveckých způsobů. Kraul, znak, prsa a pro zdatné děti i motýlek. V dětech probouzíme malé závodníky, ale také klademe důraz na hry, soutěže, potápění, lovení předmětů či skoky do vody. Plavecké kurzy jsou vstupní bránou k závodnímu plavání, nezáleží nám na věku, ale na schopnostech.\n- skupina je určená dětem, které zvládají základní plavecké dovednosti – dýchání do vody a plavání s pomůckami\nCo by dítě mělo zvládnout: plavání s pomůckami do vzdálenosti min. 10m\n\nDoporučený věk: 6 - 12 let\n\nNáplň: výuka tří plaveckých způsobů – znak, prsa, kraul, učení herní formou, výuka je vedena s cílem oblíbit si plavání jako vhodnou formu využití volného času \n', 2018, 2019, 2900, 2900, '2018-08-27 05:59:05', 'p.formankova', 16, '4ec93cb3-808e-4ca7-89f3-75cb46889d51'),
('3594d92a-0482-41d3-a62e-670bd827f904', 'Chci závodit', 'Cena: 3000,-Kč/pololetí/ 4-5 tréninků za týden- 1 trénink kondiční\n\nDo závodního plavání jsou zařazovány děti, které mají zájem o závodní a tréninkovou činnost. Snažíme se z dětí vychovávat nejen fyzicky zdatné a výkonné sportovce, ale také kvalitní osobnosti, které využívají vlastnosti získané při pravidelném trénování tj. disciplína, sebekázeň, sebekritika, kolektivní myšlení, svědomitost, vytrvalost, rozvážnost, zásadovost, aj. v samostatném vstupu do dospělého kvalitního života a zaměstnání\n- u dětí navštěvujících tuto skupinu předpokládáme zájem o účast na závodech \nCo by dítě mělo zvládnout: uplavat bez problémů  100 m základními způsoby – znak, prsa, kraul\n\nDoporučený věk: 10-15 let\n\nNáplň: zdokonalování všech plaveckých způsobů včetně motýla, charakter kondičního tréninku \n', 2018, 2019, 3000, 3000, '2018-09-05 08:32:34', 'p.formankova', 15, 'bc577f2f-b930-4164-ac73-1907c5393c67'),
('095704a2-b9ef-4f7c-b093-c45f0bb7ca86', 'Chci se zdokonalit Po 18,00, St 16,00', 'Cena: 3000,-Kč/ pololetí/ 1 trénink za týden\nNěkteré děti nechtějí být závodním plavcem, ale přesto se chtějí dále v plavání zdokonalovat nebo mají plavání jako doplňkový sport. Právě pro ně máme zdokonalovací plavání.  Zde se věnujeme rozvíjení pohybových dovedností a zdokonalování všech plaveckých způsobů. Pravidelným tréninkem zlepšujeme u dětí kondici, vytrvalost, podporujeme zdravý způsob života, ke kterému neodmyslitelně pohyb patří.\n-tuto skupinu navštěvují děti, které plavání baví, jako aktivní využití volného času, neúčastní se závodů, po domluvě s trenérem tuto účast umožňujeme\n\nCo by dítě mělo zvládnout: základy techniky plaveckých způsobů znak, prsa a kraul, uplavat bez pomoci 50m\n\nDoporučený věk: 13 - 20 let\n\nNáplň: zdokonalovaní plaveckých způsobů znak, prsa, kraul, základy motýla, plavání s pomůckami, hry\n\nPřípadné dotazy ohledně zařazení konzultujte s vedoucí plaveckých kurzů sl. Formánkovou\n\n', 2018, 2019, 3000, 3000, '2018-09-18 07:04:20', 'p.formankova', 20, 'bc577f2f-b930-4164-ac73-1907c5393c67');
